				break;
			case FETCH_NOTE_LIST_FAILURE:
				break;
			case FETCH_NOTE_REQUEST:
				break;
			case FETCH_NOTE_SUCCESS:
				break;
			case FETCH_NOTE_FAILURE:
				break;
